function dayCycle(){
    var day = new Date();
    //console.log(day)
    var hours = day.getHours();
    if(hours >= 19){
        createOrangeLeaf();
        nightEffect();
    }else if(hours <= 6){
        createOrangeLeaf();
        nightEffect();
    }else{
        createGreenLeaf()
        dayEffect();
    }
}
