function seasonCycle(){
    var season
    var date = new Date();
    
    var month = date.getMonth();

    var northTimezones = ['Europe/London', 'Europe/Berlin', 'Europe/Moscow', 'Europe/Rome', 'America/Los_Angeles', 'Asia/Calcutta', 'Asia/Shanghai', 'Asia/Tokyo', 'Canada/Atlantic'];

    var southTimezones = ['Africa/Nairobi', 'Africa/Johannesburg', 'America/Sao_Paulo', 'Australia/Perth', 'Australia/Melbourne', 'Pacific/Auckland']

    let zone = Intl.DateTimeFormat().resolvedOptions().timeZone
    //console.log(zone);

    const seasonMonth = date =>  Math.floor((month/12*4))%4;

    //Northern hemisphere
    var northSeason = ['Winter', 'Spring', 'Summer', 'Autumn'][seasonMonth(date)]

    //Southern hemisphere
    var southSeason = ['Summer', 'Autumn', 'Winter', 'Spring'][seasonMonth(date)]

    //find zone
    const north = northTimezones.includes(zone); //returns true/false
    //console.log(north)
    const south = southTimezones.includes(zone); //returns true/false
    //console.log(south)

    //create tree
    if (north){
            season = northSeason;
            console.log(season);
            
            //decide to add leaves
            switch(season){
                case "Winter":
                winterDayCycle();
                snowEffect();
                break;

                case "Spring":
                dayCycle();
                break;

                case "Summer":
                dayCycle();
                break;

                case "Autumn":
                dayCycle();
                break;

                default:
                dayCycle();
                break;
            }

    }else if(south){
            console.log(zone)
            season = southSeason;
            console.log(season);
            //createTree();

            //decide to add leaves
            //dayCycle();
            switch(season){
                case "Summer":
                dayCycle();
                break;

                case "Autumn":
                dayCycle();
                break;

                case "Winter":
                winterDayCycle();
                snowEffect();
                break;

                case "Spring":
                dayCycle();
                break;

                default:
                dayCycle();
                break;
            }
             
    }else{
        dayCycle();
    }
    
  
   
}

